import React from 'react';
import classes from './header.module.css';

const header = (props) => {
    return (
        <div className={classes.header}>
            <h2>Current City: Houston</h2>
            <div>
                <p>Search</p>
                <input></input>
            </div>
        </div>
    );
};

export default header;
